import React from 'react';
import { Create, SimpleForm, TextInput, RichTextInput, NumberInput } from 'react-admin';

function addUsers(){
    return(
    <Create>
        <SimpleForm>
            <TextInput source="title" />
            <RichTextInput source="body" />
            <NumberInput source="nb_views" />
        </SimpleForm>
    </Create>
    )
}
export default addUsers;
